import { reqShopList } from '@/api'

const state = {}

const mutations = {}

const getters = {}
const actions = {
  async searchList() {
    let result = await reqShopList()
    if (result.code === 200) {
      return 'ok'
    } else {
      return Promise.reject(new Error('fail'))
    }
  },
}

export default {
  state,
  mutations,
  getters,
  actions,
}
